import { Col, Row } from "react-bootstrap";
import cv1min from "../assets/images/cv1min.jpg";
const HomePage = () => {
  return (
    <Row className="my-auto d-flex justify-content-center">
      <Col xs={12} md={5} className="contentCarosello my-md-auto mb-4">
        <h1>
          {" "}
          Hi, <br />
          I'm Palma Iacobelli
          <ul class="content_container_list">
            <li class="content_container_list_item">Jr. web developer </li>
            <li class="content_container_list_item">Jr. front end developer</li>
            <li class="content_container_list_item">Jr. back end developer</li>
            <li class="content_container_list_item">Jr. forester</li>
          </ul>
        </h1>
      </Col>
      <Col xs={12} md={5} className="foto mx-auto my-auto">
        <img src={cv1min} className="w-100 profilo my-5" alt="foto Palma" />
      </Col>
    </Row>
  );
};
export default HomePage;
